import api from './api'

class FornecedorService {
  async getAllFornecedors() {
    const response = await api.get('/api/fornecedores/')
    return response.data
  }
  async saveFornecedor(fornecedores) {
    const response = await api.post('/api/fornecedores/', fornecedores)
    return response.data
  }
  async deleteFornecedor(fornecedores) {
    const response = await api.delete(`/api/fornecedores/${fornecedores.id}/`)
    return response.data
  }
}

export default new FornecedorService()
